description:
The code of detectives and police officers alike is to protect and serve. But what happens when the lines are blurred and one has to balance protecting their marriage and serving justice simultaneously?

Lead police investigator (Jessica Drake) has no choice but to cope with the harsh reality that her husband is the prime suspect in the disappearance of two young escorts. His infidelity fueled by her unwavering work ethic, Monica is plunged deep into the seedy, sex filled life of a lingerie model as she goes undercover to find out the truth. As she does, she discovers a hidden sexuality within. As Monicas love life with her suspect/husband is re-ignited, the truth is finally revealed. Can sex save a marriage? Only the truth can expose a life of Public Service.

Cast: Dana DeArmond, Darryl Hanah, Lindsey Meadows, Kelly Skyline, Jessica Drake, Barrett Blade, Chris Cannon, Eric Masterson, Randy Spears

